import React from "react";

function Favorites() {
  return (
    <div 
      className="favorites-container" 
      style={{ backgroundColor: "white", color: "black", padding: "20px", minHeight: "100vh", marginTop: "100px" }}
    >
      <h1 style={{ color: "blue" }}> ❤️ Your Favorite Articles</h1>
      <p>Saved articles will appear here.</p>
    </div>
  );
}

export default Favorites;
